import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom'; // for Routes in App.js
import './index.css';
import App from './App';
import './output.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter> // for Routes in App.js
    <App />
  </BrowserRouter>
);
